import { NextPage } from 'next';
import Header from './header';
import Footer from './footer';
import Sidebar from './sidebar';

let Wrapper : NextPage = props => (
    <div>
        <Header />
        <Sidebar>
        {props.children}
        </Sidebar>
        <Footer />
    </div>
);

export default Wrapper;
